INSERT INTO `cscart_page_descriptions` VALUES (3,'sl','Privacy policy','<h1><span style=\"font-size: x-large;\">Privacy Policy</span></h1>\n<p>&nbsp;</p>\n<h3>What information do we collect?</h3>\n<p>We collect information from you when you register on our site, place an order, subscribe to our newsletter or fill out a form.</p>\n<p>When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address or mailing address. You may, however, visit our site anonymously.</p>\n<p>&nbsp;</p>\n<h3>What do we use your information for?</h3>\n<p>Any of the information we collect from you may be used in one of the following ways:</p>\n<ul>\n<li>To personalize your experience<br /> (your information helps us to better respond to your individual needs)</li>\n<li>To improve our website<br /> (we continually strive to improve our website offerings based on the information and feedback we receive from you)</li>\n<li>To improve customer service<br /> (your information helps us to more effectively respond to your customer service requests and support needs)</li>\n<li>To process transactions\n<ul>\n<li>Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.</li>\n</ul>\n</li>\n<li>To administer a contest, promotion, survey or other site feature</li>\n<li>To send periodic emails<br />\n<ul>\n<li>The email address you provide for order processing, may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, related product or service information, etc.</li>\n</ul>\nNote: If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.</li>\n</ul>\n<p>&nbsp;</p>\n<h3>How do we protect your information?</h3>\n<p>We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.</p>\n<p>We offer the use of a secure server. All supplied sensitive information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems, and are required to keep the information confidential.</p>\n<p>&nbsp;</p>\n<h3>Do we use cookies?</h3>\n<p>Yes (Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information).</p>\n<p>We use cookies to help us remember and process the items in your shopping cart, understand and save your preferences for future visits and keep track of advertisements.</p>\n<p>&nbsp;</p>\n<h3>Do we disclose any information to outside parties?</h3>\n<p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</p>\n<p>&nbsp;</p>\n<h3>Third party links</h3>\n<p>Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.</p>\n<p>&nbsp;</p>\n<h3>Online Privacy Policy Only</h3>\n<p>This online privacy policy applies only to information collected through our website and not to information collected offline.</p>\n<p>&nbsp;</p>\n<h3>Your Consent</h3>\n<p>By using our site, you consent to our privacy policy.</p>\n<p>&nbsp;</p>\n<h3>Changes to our Privacy Policy</h3>\n<p>If we decide to change our privacy policy, we will post those changes on this page, and/or update the Privacy Policy modification date below.</p>\n<p>This policy was last modified on 01.12.2012</p>','','','','');
